import React, { Component } from 'react'

export default class Details extends Component {
    constructor(){
        super();
        this.state = {
            First : "",
            myText:""
        }
    }
    onChangename=(event)=>{ 
            this.setState({text: event.target.value});

    }
    changeDiv=()=>{
        this.setState({myText: this.state.text});
    }
    render() {
    return (
      <div>
          <div className='App'>
        <input type="text" value={this.state.text} onChange={this.onChangename}/>
          </div>

          <button onClick={this.changeDiv}>hi</button>
          <div>
              {this.state.myText}
          </div>

      </div>
    )

  }
}
